		<style type="text/css">
			body {
				background: grey;
			}
			.edit {
				position: fixed;
			    width: 60px;
			    height: 60px;
			    bottom: 70px;
			    right: 40px;
			    background-color: #010175;
			    color: #FFF;
			    border-radius: 50px;
			    text-align: center;
			    box-shadow: 2px 2px 3px #101010;
			    cursor: pointer;
			}

			.edit span {				
			    position: fixed;
			    margin-top: 22px;
			    margin-left: -8px;
			    font-weight: bold;
			    user-select: none;
			    cursor: pointer;

			}

			.dialog {
				display: none;
			    width: 25%;
			    height: 6%;
			    background: white;
			    position: fixed;
			    bottom: 70px;
			    right: 135px;
			    border-radius: 10px;
			}

			.dialog input {
				margin-top: 15px;
    			margin-left: 13px;
    			border: 1px solid #cec8c8;
    			padding: 5px;
    			width: 92%;
			}

			.d-none {
				display: none;
			}

			.active {
				display: block;
			}
		</style>
	</head>
	<body>
		<div class="edit">
			<span>
				<i class="fas fa-paint-brush" id="edit"></i>
				<i class="fas fa-save d-none" id="save"></i>
			</span>
		</div>
		<div class="dialog">
			<input type="text" id="__background" placeholder="background image">
		</div>
	</body>
